import {
  createBrowserRouter,
  createRoutesFromElements,
  RouterProvider,
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom'

// Layouts
import RootLayout from './Components/RootLayout';


const router = createBrowserRouter(
  createRoutesFromElements(
    <Route element={<RootLayout/>} >

    </Route>
  )
)



function App() {
  return (
    <RouterProvider router={router}/>
  );
}

export default App;
